import React from "react";
import DealsTable from "./Components/DealsTable";
import Footer from "./Components/FooterUser";

const Admin = ({
  handleLogged,
  deals,
  handleDeclineDeal,
  handleApproveDeal,
}) => {
  let navigate = useNavigate();

  const handleSingOut = (e) => {
    e.preventDefault();
    handleLogged();
    navigate("/");
  };

  return (
    <div>
      <DealsTable
        deals={deals}
        handleDeclineDeal={handleDeclineDeal}
        handleApproveDeal={handleApproveDeal}
      />
      <Footer handlelogged={handleLogged} />
    </div>
  );
};

export default Admin;
